import {li, more} from "./Litem";
function App(){
    <>
    <p>List of chawlis</p>
    <ol>
        <li>Jawad</li>
        <li>{li()}</li>
        <li>math.</li>
        <li>{more}</li>
    </ol>
    </>
}
export default App;
